import * as React from 'react';
import { Text, Flex } from '@chakra-ui/react';

export const Website = () => {
  return (
    <Flex h="space.4" border="1px solid white" p={2}>
      <Text color="gray.200">Hello World!</Text>
    </Flex>
  );
}
